import React, { useState } from 'react';
import { userID, checkLogin, setUserID } from "../components/checklogin";
import { Navigate } from "react-router-dom";
import LogoutButton from "../components/logout";
import '../App.css'
import DatePicker from "react-multi-date-picker"
import transition from "react-element-popper/animations/transition"
import opacity from "react-element-popper/animations/opacity"
import "react-multi-date-picker/styles/colors/purple.css"
import Select from 'react-select'
import Highcharts from 'highcharts'
import HighchartsReact from 'highcharts-react-official'
import Highchart from '../components/highchart';
import { render } from 'react-dom';


function AtlPage () {
  const [email, setEmail] = useState('');
  const [value1, setValue1] = useState(new Date().setDate(1))
  const [value2, setValue2] = useState(new Date())
  const options1 = [
    { value: 'ATL', label: 'Actual total load' },
    { value: 'GPT', label: 'Generation per type' },
  ]
  const options2 = [
    { value: 'GR', label: 'Greece' },
    { value: 'AL', label: 'Albania' },
  ]
  
  const Http = new XMLHttpRequest();
  const url = 'https://oauth2.googleapis.com/tokeninfo?id_token=' + userID;
  Http.open("GET", url);
  Http.send();
  Http.onreadystatechange = (e) => {
      if(Http.readyState === XMLHttpRequest.DONE) {
        //console.log(Http.responseText)
        const parsedResponse = JSON.parse(Http.responseText);
        setEmail(parsedResponse['email']);
        // window.alert(parsedResponse['email'])
      }
    }    
    
    if (userID === "EMPTY") {
      return <Navigate to="/login" />
    }
    else
    {
      //render(<Highchart/>, document.getElementById('root'));
      return(
      <div>
        <div className='ATLPage'>
          <link rel="stylesheet" href="./App.css"></link>
          <h1 className='HeaderTextATL'>EnergyLive 2022</h1>
          <main>
            <div className='LogoutPossition'>  
              <LogoutButton />
            </div>
            <h1 className='EmailText'>{ email }</h1>
          </main>
          <div className='MainContent'>
            <div className='Column_1'>
              <h1 className='TitleText'> Choose a range of Dates to plot: </h1>
              <div>
                <h1 className='From'> From: </h1>
                <div className='CaldivFrom' >
                  <DatePicker 
                    format="DD/MM/YYYY"
                    calendarPosition={`${"bottom"}-${"center"}`} 
                    weekStartDayIndex={1} 
                    className="purple" 
                    inputClass="custom-input" 
                    value={value1} 
                    onChange={setValue1} 
                    animations={[opacity(), transition({ from: 35, transition: "all 400ms cubic-bezier(0.335, 0.010, 0.030, 1.360)", })]} 
                    mapDays={({ date }) => {
                      let props = {}
                      let isWeekend = [0, 6].includes(date.weekDay.index)
                      
                      if (isWeekend) props.className = "highlight highlight-red"
                      
                      return props
                    }}
                    />
                </div>
              </div>
              <div className='Todiv'>
                <h1 className='To'> To: </h1>
                <div className='CaldivTo' >
                  <DatePicker 
                    format="DD/MM/YYYY"
                    calendarPosition={`${"bottom"}-${"center"}`} 
                    weekStartDayIndex={1} 
                    className="purple" 
                    inputClass="custom-input" 
                    value={value2} 
                    onChange={setValue2} 
                    animations={[opacity(), transition({ from: 35, transition: "all 400ms cubic-bezier(0.335, 0.010, 0.030, 1.360)", })]}
                    mapDays={({ date }) => {
                      let props = {}
                      let isWeekend = [0, 6].includes(date.weekDay.index)
                      
                      if (isWeekend) props.className = "highlight highlight-red"
                      
                      return props
                    }}
                    maxDate={new Date()}
                    />
                </div>
              </div>
              <div className='Quantity'>
                <h1 className='TitleText'> Quantity: </h1>
                <Select 
                  label="Quantity"
                  options={options1} 
                  theme={(theme) => ({
                    ...theme,
                    borderRadius: 10,
                    colors: {
                      ...theme.colors,
                      primary25: 'hotpink',
                      primary: 'purple',
                    }
                  })}
                  styles={{
                    container: style => ({
                      ...style,
                      width: '60%',
                      marginLeft: '20%'
                    }),
                    option: (base) => ({
                      ...base,
                      height: '100%',
                      borderRadius: 4,
                    }),
                  }}
                  // onChange={handleChange}
                />
              </div>
              <div className='Country'>
                <h1 className='TitleText'> Country: </h1>
                <Select 
                  label="Country"
                  options={options2}
                  theme={(theme) => ({
                    ...theme,
                    borderRadius: 10,
                    colors: {
                      ...theme.colors,
                      primary25: 'hotpink',
                      primary: 'purple',
                    }
                  })}
                  styles={{
                    container: style => ({
                      ...style,
                      width: '60%',
                      marginLeft: '20%'
                    }),
                    option: (base) => ({
                      ...base,
                      height: '100%',
                      borderRadius: 4,
                    }),
                  }}
                />
              </div>
              <button className='Refresh'><b>Refresh</b></button>
            </div>
            
            <div className='Column_2'>
              <Highchart/>
                      {/*                 *
                                          *
                                          *
                                          
                                          *********      COLUMN 2      **********
                                          
                                          *
                                          *
                                        *               */}

            </div>
          </div>
        </div>
        <div className='Options'>
          <button className='About'> About </button>
          <button className='Plans'> Plans </button>
          <button className='Legal'> Legal </button>
        </div>

      </div>
    )
  }
}



export default AtlPage;
